import './Header.css'

function func() {
    console.log("hey")
}

const Modal = ({show, onButtonClick}) => {
    if (!show) {
        return null
    }

    return (
        <div className='Wrapper'>
            <h1>Heyyy</h1>
            <p>What's good bb?</p>
            <button onClick={onButtonClick}>Close Modal</button>
        </div>
    )
}

function Header() {
    return (
        <div className="Header">
            <button className="Modify-Button" onClick={func}>
                <p>Modify</p>
            </button>
        </div>
   )
}

export default Header;
